import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './SettingsStyle.css';

const Setting = () => {
    const [blogcategories, setBlogCategories] = useState([]);

    useEffect(() => {

        axios.get('http://127.0.0.1:8000/api/blog/view/')
          .then(response => {
            console.log("Get Data about", response.data)
            setBlogCategories(response.data);
          })
          .catch(error => {
            console.error('Error fetching about page:', error);
          });

      }, []);

    return (
        <div className="setting-page">
            <div className="setting-header">
                <h1>Setting</h1>
            </div>
            <div className='setting-body'>
                <div className='Blog-category'>
                    <div className='Blog-category-input'>
                        <label>Insert Category name</label>
                        <input
                            type="text"
                            name="title"
                            value=''
                        />
                        <button type="submit" className='btn-create'>Create Category</button>
                    </div>
                    <div className='Blog-category-view'>
                        <h5>All Categories</h5>
                        <div className='Blog-category-list'>
                        <p>Categories1</p>
                        <p>Categories2</p>
                        <p>Categories3</p>
                        <p>Categories4</p>
                        <p>Categories1</p>
                        <p>Categories2</p>
                        <p>Categories3</p>
                        <p>Categories4</p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Setting;
